import m from 'mithril';
import {
  Button,
  Input,
  Icon,
  IconName,
  Icons,
  FocusManager,
  Form,
  FormGroup,
  FormLabel,
  Classes,
  Collapse,
  ControlGroup,
  List,
  ListItem,
  SelectList,
  QueryList,
  Switch,
  Card,
  Tag
} from 'construct-ui';

let seaching = false,
  session;

let Clients = {
  clientsList: [],
  loadClients: () => {
    m.request({
      method: "GET",
      url: `/api/listClients`
    }).then(res => Clients.clientsList = res)
  },
  oninit: () => {
    if (Clients.clientsList.length === 0) {
      Clients.loadClients()
    }
  },
  view: () => {
    return Clients.clientsList.map(client => {
      return m(Card, {
        class: 'client-card',
        url: client._id,
        elevated: 2,
        interactive: true,
        fluid: true
      }, m("h1#client-name", client.name + ' ' + client.surname), m(Button, {
        class: 'mail-copy-button',
        label: `mail: ${client.mail}`,
        iconLeft: Icons.COPY,
        basic: true,
        onclick: (e) => {
          navigator.clipboard.writeText(client.mail)
        }
      }))
    })
  }
}

let Searches = {
  searchesList: [],
  loadSearches: async () => {
    m.request({
      method: "GET",
      url: `/api/SearchInstances`
    }).then(res => {
      Searches.searchesList = res
      Orders.unassignedSearches = res.filter(item => item.order === 'unassigned').map(item => {
        return item
      })
    })
  },
  oninit: () => {
    if (Searches.searchesList.length === 0) {
      Searches.loadSearches()
    }
  },

  view: () => {
    return m(List, {
